import React from 'react';
import { NextPage, NextPageContext } from 'next';
import styled from 'styled-components';

const Test = styled.div`
  background-color: black;
  color: white;
`;

const Home = () => (
  <Test>
    Home
  </Test>
);

Home.getInitialProps = (context: NextPageContext) => {
  const { req } = context;
  if (req) {
    // eslint-disable-next-line @typescript-eslint/no-var-requires
    const { EpubParser } = require('@ridi/epub-parser');
    console.log('Called');
    try {
      const parser = new EpubParser('public/pg61611-images.epub');
      parser.parse().then((book) => {
        parser.readItems(book.spines).then((results) => {
          console.log('Res', results);
        });
      });
    } catch (error) {
      console.log('Error', error);
    }
  }


  return {};
};

export default Home;
